import React from 'react';
import 'bulma/css/bulma.css';
import _ from 'underscore'

const App = () => {
  const array = [1, 2, 3]
  const makeArray = () => {
    let newArray = [1, 2, 3, 4, 5, 6, 7, 8, 9, 50]

    return _.sample( newArray, 4 ).toString()
  }
  return (
    <div className="">
      Our random number : {makeArray()}

    </div>

  );
}

export default App;
